            }
            InteractiveScribbleSegmentationResponse interactiveScribbleSegmentationResp = await InteractiveScribbleSegmentationWithOptionsAsync(interactiveScribbleSegmentationReq, runtime);
            return interactiveScribbleSegmentationResp;
        }

    }
}
